INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 2, 0, 0, 1, 5118061, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, "ペコリーヌとの出会い", "青空の下で謁見", 2834);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 2, 0, 0, 1, 5118062, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, "マホとの出会い", "未来の騎空団\nマスコット？", 2835);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 40, 2, 0, 0, 1, 5118063, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, "アキノとの出会い", "お嬢さまからの\n緊急依頼", 2837);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 2, 0, 0, 1, 5118064, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, "ジュンとの出会い", "黄金色の悩みごと", 4108402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 2, 0, 0, 1, 5118065, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, "カオリとの出会い", "白熱！　格闘大会！", 4107402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "オーエド町", 10118, 40, 2, 1, 0, 1, 5118066, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, "ニノンとの出会い", "祭り太鼓はオーエドの華", 9000227);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 3, 0, 0, 1, 5118067, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, "スズナとの出会い", "人気者は遅れて\nやってくる", 2101181);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 40, 3, 0, 0, 1, 5118068, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, "ナナカとの出会い", "巫女・ミーツ・魔法少女", 4109402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 3, 0, 0, 1, 5118069, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", 4305402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 40, 3, 0, 0, 1, 5118070, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, "ユカリとの出会い", "この出会いにカンパイ！", 4101402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 40, 3, 0, 0, 1, 5118071, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, "アオイとの出会い", "陰陽アンサンブル", 4106402);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 40, 3, 1, 0, 1, 5118072, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, "シノブとの出会い", "運試し十番勝負！", 2836);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, 0, 10118, 0, 1, 0, 10145115, 0, 5118600, 0, 0, 0, "オープニング", "彼女たちの新たな日常", 0);
